const App = () => {
  const saludo = 'Hello World';
  const edad = 35;
  const dias = [1, 2, 3, 4, 5, 6, 7];
  const casado = true;

  return (
    <>
      <h1>{saludo}</h1>
      <h1>{edad}</h1>
      <h1>{dias}</h1>
      <h2>{casado}</h2>
      <p>Párrafo</p>
    </>
  );
};

export default App;
